neirong.forEach((element, index) => {    let raw = replaceImg(element.raw()); // 这是一个字符串数据    let xpath2 = params.nativeTool.XPathParserWithSource(raw);    let div2 = xpath2.queryWithXPath('//div[@id="ad"]/text()');    params.nativeTool.logWithKey(div2.length, 'div2');    if (div2.length == 0) {        // 1,3,4,5...        raw = xpath2.queryWithXPath('//div//text()').map(element2 => element2.content()).join('\n');    } else {        // 2        raw = div2.map(element2 => element2.content()).join('\n');    }    params.nativeTool.logWithKey(raw, 'raw');
    content += raw;});
return content;

